品牌简介
Joseph Rico（1876-1957）出生于意大利.少年时和兄弟移居美国。Joseph精通竖琴，钢琴很吉他演奏，他的兄弟是一名曼陀林琴和小提琴演奏家。经过辛勤的努力，两人分别成为了芝加哥和纽约知名的音乐家。Joseph Rico开始作曲和指挥，随后转站来到巴黎，成为了一名备受欢迎的作曲家。1926年，Joseph的外甥，华尔特迪斯尼工作室的单簧管演奏者Frank De Michele给他写信抱怨说，在洛杉矶想找到好的哨片非常困难。Joseph很快便找到了哨片并寄给了他。在收到多封要求寄哨片的来信之后，Joseph的哨片供应商很遗憾地解释说由于苇料短缺，他们无非在提供更多的哨片了。他的外甥问Joseph是否可以寄些苇料过去然后自己尝试制作哨片。后来，Joseph在法国南部的Var地区找到了优质的芦苇杆。1928年，Joseph Rico将批350千克的芦苇杆运到美国。为了表示对舅舅的敬意，Frank问Joseph是否能以他的姓“Rico”来命名其推出的批哨片产品。不久以后，找到四个合作伙伴成立了家Rico哨片工厂。



